// src/components/RecipeResults.js
import React from 'react';

function RecipeResults({ recipes }) {
    return (
        <div>
            <h2>Recipe Results</h2>
            {recipes.map(recipe => (
                <div key={recipe._id}>
                    <h3>{recipe.name}</h3>
                    <ul>
                        {Array.isArray(recipe.ingredients) ? recipe.ingredients.map(ingredient => (
                            <li key={ingredient}>{ingredient}</li>
                        )) : <li>No ingredients available or incorrect format</li>}
                    </ul>
                </div>
            ))}
        </div>
    );
}


export default RecipeResults;
